{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/zsetash/cyclistic-bikeshare-case-study?scriptVersionId=137501461\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"aef0512b","metadata":{"_kg_hide-output":false,"execution":{"iopub.execute_input":"2023-07-20T21:07:34.312164Z","iopub.status.busy":"2023-07-20T21:07:34.309549Z","iopub.status.idle":"2023-07-20T21:07:34.457608Z"},"papermill":{"duration":0.008618,"end_time":"2023-07-21T19:14:28.617016","exception":false,"start_time":"2023-07-21T19:14:28.608398","status":"completed"},"tags":[]},"source":["# Introduction\n","\n","Cyclistic is a (fictional) bikeshare company based in Chicago.  Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members.The marketing director has set the goal of converting existing casual users into annual members. The data for this analysis is provided [here](https://divvy-tripdata.s3.amazonaws.com/index.html). My analysis is focusing on the time frame of July 2022 - June 2023. In order to guide business decisions, I am focusing on a singular question:\n","\n","How do annual **members** and **casual** riders use Cyclistic bikes differently?\n","\n","# Preparing Data\n","\n","### Limitations\n","\n","The current data records rides, not riders. I do not have information to compare how many times a specific rider uses the service. I also do not have any information about the cost of the rides. The best way to convince people to sign up for a membership is to convince them that it is the more cost effective choice. I do not currently know how the cost for the customes varies across the different passes.\n","\n","## Cleaning Data\n","\n","Prior to importing the data into R, I made some cleaning adjustments. I verified that the column names were consistent across files. I added the column *ride_length* using the difference between the columns *ended_at* and *started_at* in order to later learn more about the differences in ride lengths between users. I also added a *day_of_week* column using the WEEKDAY function in order to later compare usage across days of the week.\n","\n","### Importing Packages and Data"]},{"cell_type":"code","execution_count":1,"id":"eb1b87bb","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2023-07-21T19:14:28.635463Z","iopub.status.busy":"2023-07-21T19:14:28.633257Z","iopub.status.idle":"2023-07-21T19:14:56.632961Z","shell.execute_reply":"2023-07-21T19:14:56.630976Z"},"papermill":{"duration":28.012467,"end_time":"2023-07-21T19:14:56.636601","exception":false,"start_time":"2023-07-21T19:14:28.624134","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.2     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.2     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.2     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.1     \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n"