Z","iopub.status.busy":"2023-07-21T19:15:55.616576Z","iopub.status.idle":"2023-07-21T19:15:58.443854Z","shell.execute_reply":"2023-07-21T19:15:58.441648Z"},"papermill":{"duration":2.842562,"end_time":"2023-07-21T19:15:58.446684","exception":false,"start_time":"2023-07-21T19:15:55.604122","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["[1] \"Removed 167665 rows with impossible or inauthentic values\"\n"]}],"source":["year_clean_times <- year_clean %>% \n","  filter(ride_time_minutes > 2) \n","print(paste(\"Removed\", nrow(year_clean) - nrow(year_clean_times), \"rows with impossible or inauthentic values\"))"]},{"cell_type":"markdown","id":"9b41eb68","metadata":{"papermill":{"duration":0.009937,"end_time":"2023-07-21T19:15:58.466437","exception":false,"start_time":"2023-07-21T19:15:58.4565","status":"completed"},"tags":[]},"source":["I then added columns that documented the day of the week of the ride start times. I also added a column that gave the start times a \"time of day\", splitting the times into morning, afternoon, evening, and night."]},{"cell_type":"code","execution_count":8,"id":"24e9b943","metadata":{"execution":{"iopub.execute_input":"2023-07-21T19:15:58.49016Z","iopub.status.busy":"2023-07-21T19:15:58.488603Z","iopub.status.idle":"2023-07-21T19:16:06.3463Z","shell.execute_reply":"2023-07-21T19:16:06.344389Z"},"papermill":{"duration":7.872986,"end_time":"2023-07-21T19:16:06.349283","exception":false,"start_time":"2023-07-21T19:15:58.476297","status":"completed"},"tags":[]},"outputs":[],"source":["year_clean_times <- year_clean_times %>% \n","  mutate(day_of_week = wday(started_at, label = TRUE))\n","\n","breaks <- hour(hm(\"00:00\", \"4:00\", \"12:00\", \"19:00\", \"23:00\"))\n","labels <- c(\"Night\", \"Morning\", \"Afternoon\", \"Evening\")\n","\n","year_clean_times$time_of_day <- cut(x=hour(year_clean_times$started_at), breaks = breaks, labels = labels, include.lowest=TRUE)"]},{"cell_type":"markdown","id":"